import React,{ Component } from 'react';
import './select-data.css';

import WeatherService from '../../services/weather-service';


export default class SelectData extends Component{

	weatherService = new WeatherService();

	constructor(props){
		super(props);
		this.state = {
			temp: null,
			city: null,
			country: null,
			sunrise: null,
			sunset: null,
			error: null
		}
	}
	render(){

		const {temp,city,country,sunrise,sunset} = this.state;

		return(

				<React.Fragment>
					<form>
						<input type="text" placeholder="Введите город"/>
						<button></button>
					</form>

					<ul className="country_list">
						<li>
							<span className="item">temp</span>
							<span className="item_data">{temp} </span>
						</li>
						<li>
							<span className="item">city</span>
							<span className="item_data">{city}</span>
						</li>
						<li>
							<span className="item">country</span>
							<span className="item_data">{country}</span>
						</li>
						<li>
							<span className="item">sunrise</span>
							<span className="item_data">{sunrise}</span>
						</li>
						<li>
							<span className="item">sunset</span>
							<span className="item_data">{sunset}</span>
						</li>
					</ul>

				</React.Fragment>


		);

	}
}
